import Link from 'next/link';

const about = () => {
    return (
        <div className="container">
            <ul>
                <li><Link href="/">Home</Link></li>
                <li><Link href="/about"><a>About</a></Link></li>
            </ul>
            <h1>About a bitcoin Price</h1>
        </div>
    );
};
export default about;
